/// <summary>
/// Class <c>WHSWorkExecuteShowWorkLineListConstants</c> contain constants used in show work line list page.
/// </summary>
internal static class WHSWorkExecuteShowWorkLineListConstants
{
    /// <summary>
    /// The control name used in work line list header label.
    /// </summary>
    internal static str WorkLineList = 'Work line list';

    /// <summary>
    /// The control name used in skip to button.
    /// </summary>
    internal static str SkipToButton = 'SkipTo';

    /// <summary>
    /// The control name used in cancel button.
    /// </summary>
    internal static str CancelResetProcessButton = 'CancelResetProcess';

    /// <summary>
    /// Key used in pass <c>Map</c> that points to line number of in-process work line before showing work line list.
    /// </summary>
    internal static str PrevLineNum = 'PrevLineNum';

    /// <summary>
    /// Key used in pass <c>Map</c> that points to line number of selected work line in work line list.
    /// </summary>
    internal static str SelectedLineNum = 'SelectedLineNum';

    /// <summary>
    /// Key used in pass <c>Map</c> that points to whether to jump work line list form during work line picking process.
    /// </summary>
    internal static str SkipLines = 'SkipLines';

    /// <summary>
    /// Key used in pass <c>Map</c> that points to whether to show work line list before starting to process work line.
    /// </summary>
    internal static str ShowWorkLineList = 'ShowWorkLineList';
}
